import Service from './Actions/Service';

const cardWidth = 950
const useStyles = makeStyles(theme =>({
    root:{
        width : cardWidth 
    }
}))
const ARCard = () => {
    const classes = useStyles();
    return ( 
        <div>
            <Card className= {classes.root}>
                <CardHeader 
